import api from '@/utils/requests.js'
import qs from 'qs'
// 发送订单商品信息
function sendOrder(orderData){
    return api.post('http://localhost:8000/user/order_commodity', qs.stringify({username:orderData.name, password:orderData.pwd}))
}
export default sendOrder
